window.bookSummaryJSON = "<p>From <i>New York Times</i> best-selling author, Deanna Chase, the eighth book in the Jade Calhoun series.</p> <p>Between enjoying her first pregnancy and helping her two besties plan their weddings, Jade Calhoun's life is just about perfect. But when two novice magical TV stars walk into her life, suddenly her magic goes haywire. Is the pregnancy causing her power to fizzle, or is it something else?</p> <p>Now with her empath abilities on the fritz, a newbie TV witch in need of instruction, and a sinister evil lurking in the background, Jade must find a way to navigate her new and unusual powers, keep her unborn child safe, and somehow save everyone she loves and the city of New Orleans... again.</p>"; 
